import React,{Component} from "react"
import { waitForElement } from "@testing-library/react"

class Profile extends Component{
    
    state={
        user:[],
        profilenumber: 11,
    }




    componentDidMount(){
            fetch(`http://localhost:3000/profile/${this.state.profilenumber}`)
            .then(response => response.json())
            .then(data=>{
                this.setState({
                    user: data
                })
                console.log(data)
            })
    }
    
    
    render(){
        return(
            <div>
                    <ul style={{listStyleType:"none"}}>
                    {this.state.user.map(element => {

                        return(
                           <div> 
                        <li key={element.user_id}>Name {element.fullname}</li> 
                        <li > Contact {element.contact}</li>
                        </div>
                        )
                    })}
                    </ul>
            </div>
        )
    }
}


export default Profile
